import React, { Component } from 'react';
import { StyleSheet, Text, View, SafeAreaView, Image, Picker, ScrollView, TouchableOpacity } from 'react-native';
import { CommonColors, CommonStyles } from './style';
import { UnderlineIcon } from '../components/icons';
import { Button, Menu } from '../components/Button';
import { w, h } from '../utils/scale'

export default ({ navigation }) => {

  return (
    <View style={CommonStyles.overflowContainer}>
      <Menu />
      <SafeAreaView style={CommonStyles.container}>
        <ScrollView style={CommonStyles.container}>
          <View style={[CommonStyles.padding, CommonStyles.paddingT100]}>
            <Text style={CommonStyles.title}>My Tournament Ranking</Text>

            <View style={styles.section}>
              <Text style={CommonStyles.sectionTitle}>Zurich Classic of New Orleans</Text>
              <View style={styles.padding20}>
                <UnderlineIcon />
              </View>
              <Text style={CommonStyles.rowTitle}>April 29, 2021 - May 2, 2021</Text>
            </View>
            <View style={styles.row}>
              <Text style={CommonStyles.sectionTitle}>USER NAME</Text>
              <Text style={CommonStyles.sectionTitle}>RANKING</Text>
            </View>

            <View style={styles.row}>
              <Text style={[CommonStyles.rowTitle, { color: CommonColors.Green }]}>golfpro123</Text>
              <Text style={[CommonStyles.sectionTitle, , { color: CommonColors.Green }]}>30</Text>
            </View>
            <View style={styles.row}>
              <Text style={CommonStyles.rowTitle}>golferguide</Text>
              <Text style={CommonStyles.sectionTitle}>20</Text>
            </View>
            <View style={styles.row}>
              <Text style={CommonStyles.rowTitle}>golfsserguide</Text>
              <Text style={CommonStyles.sectionTitle}>13</Text>
            </View>
          </View>
        </ScrollView>
      </SafeAreaView>
      <View style={styles.bottom}>
        <View style={styles.left}>
          <View style={styles.leftTop}>
            <Text style={CommonStyles.sectionTitle}>RABBIT PURSE</Text>
            <Text style={[CommonStyles.smallText, { paddingLeft: 4 }]}>Top Five Winners</Text>
          </View>
          <View style={styles.leftBottom}>
            <Image source={require('./../assets/brand.png')} style={styles.brand} />
            <Text style={[CommonStyles.sectionTitle, { color: CommonColors.LightGrey }]}>DRIVER | TSi2 DRIVER</Text>
          </View>
        </View>
        <Image source={require('./../assets/group542.png')} style={styles.image} />
      </View>
      <Button title="COLLECT MY RABBIT PURSE" onPress={() => navigation.navigate('Purse')} backgroundColor={CommonColors.Green} style={{ width: '100%' }} />
    </View>
  );
}

const styles = StyleSheet.create({
  row: {
    flex: 1,
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingVertical: w(10)
  },
  padding20: {
    paddingVertical: w(20)
  },
  section: {
    paddingVertical: w(40),
  },
  bottom: {
    backgroundColor: CommonColors.White,
    paddingLeft: w(40),
    paddingVertical: w(20),
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between'
  },
  image: {
    width: w(200),
    height: '100%',
    resizeMode: 'contain',
  },
  brand: {
    width: w(160),
    resizeMode: 'contain',
  },
  leftTop: {
    flexDirection: 'row',
    alignItems: 'flex-end'
  },
  leftBottom: {
    flexDirection: 'row',
    paddingVertical: 4,
  },
  bottomButtonContainer: {
    paddingVertical: w(20),
    backgroundColor: CommonColors.Green,
    flexDirection: 'row',
    justifyContent: 'space-evenly'
  }
});
